import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';  // Navbar component
import InfoSection from './components/InfoSection';  // Info Section component
import MainPoster from './components/MainPoster';  // Main Poster component
import EventButtons from './components/EventButtons';  // Event Buttons component
import Footer from './components/Footer';  // Footer component
import EventDetail from './components/EventDetail';  // EventDetail component (event details page)
import './styles.css';  // Global styles for your app

const App = () => {
  return (
    <Router>
      {/* Navbar component */}
      <Navbar />

      <main>
        {/* Routes for different pages */}
        <Routes>
          {/* Route for the home page (main content) */}
          <Route path="/" element={<><InfoSection /><MainPoster /><EventButtons /></>} />

          {/* Routes for individual event detail pages */}
          <Route path="/event1" element={<EventDetail eventId="event1" />} />
          <Route path="/event2" element={<EventDetail eventId="event2" />} />
          <Route path="/event3" element={<EventDetail eventId="event3" />} />
          <Route path="/event4" element={<EventDetail eventId="event4" />} />
          <Route path="/event5" element={<EventDetail eventId="event5" />} />
        </Routes>
      </main>

      {/* Footer component */}
      <Footer />
    </Router>
  );
};

export default App;
